import React from 'react';

function FacilitiesList() {
  const facilities = [
    { name: "Facility 1" },
    { name: "Facility 2" },
    { name: "Facility 3" },
    { name: "Facility 4" },
    { name: "Facility 5" }
  ];

  const facilityLogo = "https://cdn.builder.io/api/v1/image/assets/TEMP/64f86958cbb3ab0d42bdcfc7e147c123b5342f5eae207c89f0bbb848ea0d1c67?placeholderIfAbsent=true&apiKey=8f0d2cc9bf764b679624a1d309a49f82"; // Facility image URL

  return (
    <section className="flex z-10 flex-col self-end mt-0 max-w-full text-sm font-thin leading-5 text-gray-800 bg-white h-[395px] w-[648px]">
      <h3 className="sr-only">Facilities List</h3>
      <div className="flex gap-2.5 py-4 w-full rounded border border border-solid min-h-[58px] max-md:max-w-full">
        <img 
          loading="lazy" 
          src={facilityLogo} 
          alt="" 
          className="object-contain z-10 self-center mt-12 ml-28 aspect-[1.18] w-[53px] max-md:mt-10" 
        />
      </div>
      <ul className="flex flex-col px-px pt-4 pb-px w-full border-r border-b border-l border-solid max-md:max-w-full">
        {facilities.map((facility, index) => (
          <li key={index} className="flex flex-wrap gap-3 px-6 py-3 w-full max-md:px-5 max-md:max-w-full">
            <img
              loading="lazy"
              src={facilityLogo} // Facility logo for all items
              alt={facility.name}
              className="w-8 h-8 rounded-full" // Ensure the images are rounded and sized properly
            />
            <div className="flex-auto my-auto w-[538px] max-md:max-w-full">{facility.name}</div>
          </li>
        ))}
      </ul>
    </section>
  );
}

export default FacilitiesList;
